import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  getname () {
    return prompt('Print you name');
  }
  constructor () {
    super();
    this.name = " root";
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p id="hello">Hello {this.getname() + this.name}</p> 
        </header>
      </div>
    );
  }
}

export default App;
